package com.eco.study.leetcode.string;

import java.util.HashMap;
import java.util.Map;
import java.util.Set;

/**
 * ClassName Lesson242
 * Description
 * Date 2021/8/26
 * Author wangxiyue.xy@163.com
 *
 * 242. 有效的字母异位词
 * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。
 *
 * 注意：若 s 和 t 中每个字符出现的次数都相同，则称 s 和 t 互为字母异位词。
 *
 * 示例 1:
 *
 * 输入: s = "anagram", t = "nagaram"
 * 输出: true
 * 示例 2:
 *
 * 输入: s = "rat", t = "car"
 * 输出: false
 *
 * 提示:
 *
 * 1 <= s.length, t.length <= 5 * 104
 * s 和 t 仅包含小写字母
 *
 * 进阶: 如果输入字符串包含 unicode 字符怎么办？你能否调整你的解法来应对这种情况？
 *
 */
public class Lesson242 {

    public static void main(String[] args) {
        String s = "";
        String t = "";
        Solution242 solution = new Solution242();
        System.out.println(solution.isAnagram(s,t));
    }
}

class Solution242 {



    /**
     * @see Lesson383 参考 canConstruct 字符串查找方法
     */
    public boolean isAnagram2(String s , String t){
        String noteStr = null;
        for (int i = 0; i < s.length(); i++) {
            noteStr = s.substring(i,i+1);
            if(t.indexOf(noteStr) ==-1){
                return false;
            }else {
                i--;
                s = s.replaceFirst(noteStr,"");
                t = t.replaceFirst(noteStr,"");
                if(t.length() != s.length()){
                    return false;
                }
            }
            System.out.println(s);
        }
        return true;
    }

    /**
     * @see Lesson383 参考 canConstruct2 Map计数法
     */
    public boolean isAnagram(String s, String t) {
        Map<String, Integer> sMap = countCharSumToMap(s);
        Map<String, Integer> tMap = countCharSumToMap(t);
        Set<String> keySetMaxSize = sMap.keySet().size() > tMap.keySet().size()?sMap.keySet() : tMap.keySet();
        for (String key : keySetMaxSize) {
            if( tMap.getOrDefault(key,0).intValue() !=  sMap.getOrDefault(key,0) .intValue()){
                return false;
            }
        }
        return true;
    }

    private Map<String,Integer> countCharSumToMap(String targetString){
        HashMap<String,Integer> sumChar = new HashMap<>();
        for (int i = 0; i < targetString.length(); i++) {
            sumChar.put(String.valueOf(targetString.charAt(i)),
                    sumChar.getOrDefault(String.valueOf(targetString.charAt(i)),0)+1);
        }
        return sumChar;
    }
}